import { useRouter } from "next/router";
import Header from "../components/Header";
import Footer from "../components/Footer";

const Spare_parts = () => {
  const router = useRouter();

  return (
    <>
      <Header />
      <div className="container mx-auto p-4">

      </div>
      <Footer />
    </>
  );
};

export default Spare_parts;
